import { Box, ChakraProvider } from "@chakra-ui/react";

import SideBar from "./components/SideBar";
import theme from "./theme";

function App() {
  return (
    <Box>
      <ChakraProvider theme={theme}>
        <SideBar />
      </ChakraProvider>
    </Box>
  );
}

export default App;
